import React from 'react';
import { useNavigate } from 'react-router-dom';
import backgroundImg from '../images/allbg.png'; // Verify this path

const About = () => {
  const navigate = useNavigate();

  const startPlaying = () => {
    navigate('/Game'); // Redirects to the Game page
  };

  return (
    <div
      className="relative w-full min-h-screen bg-cover bg-center bg-no-repeat flex flex-col items-center justify-center p-8"
      style={{ backgroundImage: `url(${backgroundImg})` }}
    >
      {/* Overlay for better readability */}
      <div className="absolute inset-0 bg-purple-800 opacity-20"></div>

      {/* Content Container */}
      <div className="relative z-10 max-w-4xl w-full bg-white bg-opacity-20 rounded-lg shadow-2xl p-12 flex items-center justify-center">
        <h1 className="text-center text-6xl font-extrabold text-yellow-300">
          Think about a number
        </h1>
      </div>
    </div>
  );
};

export default About;
